import React from 'react';
import { ChartZoomLevel } from 'components';
import { withKnobs, text, boolean, array } from '@storybook/addon-knobs';
import { Grid } from '@material-ui/core';

export default {
  title: 'ChartZoomLevel',
  component: ChartZoomLevel,
  decorators: [withKnobs],
};

const gridStyles = {
  lineHeight: 1,
  position: 'relative',
};
const label = 'Zoom Level';
// TODO : check how this data structure should look like
const defaultValue = ['Level 1', 'Level 2'];
const levels = array(label, defaultValue);
export const Default = () => {
  return (
    <Grid container spacing={2} justifyContent="center" alignItems="center">
      <Grid item style={gridStyles}>
        <ChartZoomLevel levels={levels} onLevelChange={() => {}} level={text('Level', 'Level 1')} disabled={boolean('Disabled', false)} />
      </Grid>
    </Grid>
  );
};
